@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix : <http://www.example.com/> .

:FailedLoginEvent rdf:type owl:Class .
:record rdf:type owl:ObjectProperty ;
    rdfs:domain :FailedLoginEvent ;
    rdfs:range :Attempt .

:Attempt rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty :record ;
                          owl:qualifiedCardinality "3"^^xsd:nonNegativeInteger ;
                          owl:onClass :FailedLoginEvent ] .

:flag rdf:type owl:ObjectProperty ;
    rdfs:domain :Attempt ;
    rdfs:range :Flag .

:Flag rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty :flag ;
                          owl:qualifiedCardinality "1"^^xsd:nonNegativeInteger ;
                          owl:onClass :Attempt ] .
